&lt;main class=&quot;container-fluid mx-4&quot;&gt;
  &lt;h1 class=&quot;text-center my-3 my-md-4&quot;&gt;
    Términos y condiciones de
    &lt;span class=&quot;fw-bold text-decoration-underline&quot;&gt;Insumos_FAT&lt;/span&gt;
  &lt;/h1&gt;

  &lt;div class=&quot;row&quot; style=&quot;text-align: justify&quot;&gt;
    &lt;div class=&quot;col-md-8 offset-md-2 mt-3&quot;&gt;
      &lt;p class=&quot;lead&quot;&gt;
        En &lt;span class=&quot;fw-bold&quot;&gt;Insumos_FAT&lt;/span&gt;, valoramos tu privacidad y nos
        comprometemos a proteger la información personal que nos proporcionas
        cuando utilizas nuestros servicios en línea. Esta Política de Privacidad
        Extendida describe cómo recopilamos, utilizamos, compartimos y
        protegemos tu información cuando interactúas con nuestra tienda en
        línea, ya sea a través de nuestro sitio web o de nuestra aplicación
        móvil.
      &lt;/p&gt;

      &lt;h2&gt;1. Información que Recopilamos:&lt;/h2&gt;
      &lt;ul&gt;
        &lt;li&gt;
          &lt;strong&gt;Información de Identificación Personal:&lt;/strong&gt; Recopilamos
          información como tu nombre, dirección de correo electrónico, dirección
          de envío y número de teléfono cuando creas una cuenta, realizas una
          compra o nos contactas para solicitar asistencia.
        &lt;/li&gt;
        &lt;li&gt;
          &lt;strong&gt;Información de Pago:&lt;/strong&gt; Cuando realizas una compra,
          recopilamos información de pago, como números de tarjeta de crédito o
          débito, para procesar tus transacciones de manera segura y eficiente.
        &lt;/li&gt;
        &lt;li&gt;
          &lt;strong&gt;Información de Uso:&lt;/strong&gt; Recopilamos información sobre
          cómo interactúas con nuestro sitio web o nuestra aplicación, incluidos
          los libros que visualizas, añades al carrito o compras, así como tu
          actividad de navegación y patrones de uso.
        &lt;/li&gt;
        &lt;li&gt;
          &lt;strong&gt;Información de Dispositivos:&lt;/strong&gt; Podemos recopilar
          información sobre el dispositivo que utilizas para acceder a nuestros
          servicios, como tu dirección IP, tipo de navegador, sistema operativo
          y identificadores únicos de dispositivos.
        &lt;/li&gt;
      &lt;/ul&gt;

      &lt;h2&gt;2. Uso de la Información:&lt;/h2&gt;
      &lt;p class=&quot;lead&quot;&gt;
        Utilizamos la información que recopilamos para procesar tus pedidos,
        proporcionarte servicios personalizados, mejorar la funcionalidad de
        nuestro sitio web y aplicación, y comunicarnos contigo sobre tu cuenta y
        tus compras. También podemos utilizar tu información para enviarte
        correos electrónicos promocionales, boletines informativos u otra
        información relevante sobre nuestros productos y servicios, siempre y
        cuando hayas dado tu consentimiento para recibir dichas comunicaciones.
      &lt;/p&gt;

      &lt;h2&gt;3. Compartir Información:&lt;/h2&gt;
      &lt;p class=&quot;lead&quot;&gt;
        No vendemos, alquilamos ni compartimos tu información personal con
        terceros con fines comerciales sin tu consentimiento expreso, excepto
        según lo requiera la ley o en cumplimiento de una orden judicial.
        Podemos compartir tu información con proveedores de servicios de
        confianza que nos ayudan a operar nuestro negocio y prestar servicios a
        nuestros clientes, como procesadores de pagos, servicios de envío y
        proveedores de alojamiento web.
      &lt;/p&gt;

      &lt;h2&gt;4. Seguridad de la Información:&lt;/h2&gt;
      &lt;p class=&quot;lead&quot;&gt;
        Implementamos medidas de seguridad técnicas, administrativas y físicas
        para proteger tu información contra accesos no autorizados, divulgación,
        alteración o destrucción. Sin embargo, debes tener en cuenta que ninguna
        medida de seguridad es absolutamente infalible, y no podemos garantizar
        la seguridad absoluta de tu información en todo momento.
      &lt;/p&gt;

      &lt;h2&gt;5. Tus Derechos:&lt;/h2&gt;
      &lt;p class=&quot;lead&quot;&gt;
        Tienes derecho a acceder, corregir, actualizar o eliminar tu información
        personal en cualquier momento. Puedes hacerlo iniciando sesión en tu
        cuenta o contactándonos directamente. También tienes derecho a optar por
        no recibir comunicaciones de marketing por correo electrónico en
        cualquier momento, siguiendo las instrucciones de cancelación de la
        suscripción incluidas en cada correo electrónico o contactándonos para
        actualizar tus preferencias de comunicación.
      &lt;/p&gt;

      &lt;h2&gt;6. Menores de Edad:&lt;/h2&gt;
      &lt;p class=&quot;lead&quot;&gt;
        Nuestros servicios no están dirigidos a menores de 18 años, y no
        recopilamos de manera consciente información personal de personas
        menores de esa edad. Si tienes menos de 18 años, no utilices nuestros
        servicios ni nos proporciones información personal.
      &lt;/p&gt;

      &lt;h2&gt;7. Cambios en esta Política:&lt;/h2&gt;
      &lt;p class=&quot;lead&quot;&gt;
        Nos reservamos el derecho de actualizar o modificar esta Política de
        Privacidad en cualquier momento. Cualquier cambio entrará en vigor
        inmediatamente después de su publicación en nuestro sitio web. Te
        recomendamos que revises periódicamente esta política para estar al
        tanto de cualquier cambio.
      &lt;/p&gt;

      &lt;p class=&quot;lead&quot;&gt;
        Al utilizar nuestros servicios, aceptas los términos y condiciones
        establecidos en esta Política de Privacidad. Si tienes alguna pregunta o
        inquietud sobre nuestra política o prácticas de privacidad, no dudes en
        contactarnos.
      &lt;/p&gt;

